import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import CurrencyList from './pages/currencyList';

function App() {

  return (
    <Router>
      <Routes>
        <Route path="/" element={<CurrencyList/>}/>
        <Route path="/detail" element={<CurrencyList/>}/>
      </Routes>
    </Router>
  );
}

export default App;
